4410	\N	\N	3210	'1':141 '1896':137 '1897':46,96 '1951':81 '1954':70 '1973':109,130 '1974':124 '1988':55 '1994':31 '1997':83 '2000':22,85 '2013':116 '2021':143 'a':10 'academy':16,68,186 'among':40 'ancient':7 'and':71,84,97,131,153,157,180 'antike':120 'antiken':104 'antiquarian':87 'antiquorum':78 'archaeological':160 'archaeology':155,179 'archologie':26,51 'at':13,183 'austrian':15,159,185 'balkan':92 'balkan-kommission':91 'been':62,146 'between':82 'classical':181 'corpus':76,102 'created':29 'culture':8 'das':75,101 'department':88 'der':103 'emerged':20,53 'ephesos':59 'european':154 'field':177 'finally':114 'focuses':170 'for':3,151 'forschungsstelle':25 'foundational':173 'founded':44,79,94,107,122,128,135 'from':23,56 'fr':49,74,100,119 'had':61 'has':145 'ikant':9,113,144 'in':21,30,45,54,80,95,108,115,123,129,136,175 'include':39 'incorporated':111,139 'institute':2,12,150,161,169 'into':112 'january':142 'kleinasiatische':133 'kleinasiens':106 'kommission':48,73,93,99,118,127,134 'kommissionen':37 'limeskommission':43 'merged':147 'merger':34 'mosaiken':105 'name':165 'new':168 'numismatische':126 'oeai':162,166 'oeaw':19,189 'of':6,17,35,66,89,178,187 'on':140,171 'orea':156 'oriental':152 'others':41 'patronage':65 'praktische':50 'rechtsgeschichte':121 'research':11,174 'sciences':18,188 'several':36 'since':69 'studies':182 'study':5 'the':1,4,14,24,33,42,47,57,64,67,72,86,90,98,117,125,132,149,158,164,167,172,176,184 'these':38 'through':32 'under':63,163 'unternehmen':58 'vasorum':77 'was':28 'were':110,138 'which':27,52,60 'with':148	The Institute for the Study of Ancient Culture (IKAnt), a research institute at the Austrian Academy of Sciences (OeAW), emerged in 2000 from the Forschungsstelle Archologie, which was created in 1994 through the merger of several Kommissionen. These include among others the Limeskommission (founded in 1897), the Kommission fr Praktische Archologie (which emerged in 1988 from the Unternehmen Ephesos, which had been under the patronage of the Academy since 1954) and the Kommission fr das Corpus Vasorum Antiquorum (founded in 1951). Between 1997 and 2000, the Antiquarian Department of the Balkan-Kommission (founded in 1897) and the Kommission fr das Corpus der antiken Mosaiken Kleinasiens (founded in 1973) were incorporated into IKAnt. Finally, in 2013, the Kommission fr Antike Rechtsgeschichte (founded in 1974), the Numismatische Kommission (founded in 1973) and the Kleinasiatische Kommission (founded in 1896) were incorporated.\nOn 1 January 2021, IKAnt has been merged with the Institute for Oriental and European Archaeology (OREA) and the Austrian Archaeological Institute (OeAI). Under the name OeAI, the new institute focuses on the foundational research in the field of archaeology and classical studies at the Austrian Academy of Sciences (OeAW).
4411	\N	\N	3211	'1':124 '1896':122 '1897':41,85 '1951':71 '1954':55 '1973':97,116 '1974':111 '1988':47 '1994':27 '1997':73 '2000':20,75 '2013':101 '2021':126 'a':37 'abteilung':79 'akademie':13,60,165 'altertumswissenschaften':161 'an':10,162 'antike':6,108 'antiken':93 'antiquarische':78 'antiquorum':69 'archologie':24,46,136,159 'archologischen':141 'auf':155 'aus':21,49 'balkan':82 'balkan-kommission':81 'bezeichnung':147 'bndelt':149 'corpus':67,91 'das':1,53,66,90,150 'dem':50,130,139,156 'den':29 'der':5,11,14,22,57,59,80,92,105,112,118,146,158,163,166 'die':26,38,42,63,77,87,153 'durch':28 'eine':8 'eingegliedert':100 'eingliederung':104 'entstanden':34 'ephesos':52 'erfolgte':103 'europische':135 'forschungseinrichtung':9 'forschungsstelle':23 'fusioniert':144 'fr':3,44,65,89,107,132 'gebiet':157 'gegr':70,84,96,110,115,121 'gegrndet':40 'ging':17 'grundlagenforschung':154 'hervor':25 'hervorgegangen':48 'ikant':7,99,128 'im':18 'ins':98 'institut':2,131,142,152 'jahre':19 'jnner':125 'kleinasiatischen':119 'kleinasiens':95 'kommission':43,64,83,88,106,114,120 'kommissionen':33 'kulturgeschichte':4 'limeskommission':39 'mehrerer':31 'mit':123,129 'mosaiken':94 'neue':151 'numismatischen':113 'orea':137 'orientalische':133 'patronanz':58 'praktische':45 'rechtsgeschichte':109 'schlielich':102 'seit':54 'stand':61 'u':36 'und':62,74,86,117,134,138,160 'unter':56,145 'unternehmen':51 'vasorum':68 'war':35 'wissenschaften':15,167 'wurde':76,127 'zusammenschluss':30 'zwischen':72 'ai':143,148 'aw':16,32,168 'sterreichischen':12,140,164	Das Institut fr Kulturgeschichte der Antike (IKAnt), eine Forschungseinrichtung an der sterreichischen Akademie der Wissenschaften (AW), ging im Jahre 2000 aus der Forschungsstelle Archologie hervor, die 1994 durch den Zusammenschluss mehrerer AW Kommissionen entstanden war: u. a. die Limeskommission (gegrndet 1897), die Kommission fr Praktische Archologie (1988 hervorgegangen aus dem Unternehmen Ephesos, das seit 1954 unter der Patronanz der Akademie stand) und die Kommission fr das Corpus Vasorum Antiquorum (gegr. 1951). Zwischen 1997 und 2000 wurde die Antiquarische Abteilung der Balkan-Kommission (gegr. 1897) und die Kommission fr das Corpus der antiken Mosaiken Kleinasiens (gegr. 1973) ins IKAnt eingegliedert. 2013 schlielich erfolgte Eingliederung der Kommission fr Antike Rechtsgeschichte (gegr. 1974), der Numismatischen Kommission (gegr. 1973) und der Kleinasiatischen Kommission (gegr. 1896).\nMit 1. Jnner 2021 wurde IKAnt mit dem Institut fr Orientalische und Europische Archologie (OREA) und dem sterreichischen Archologischen Institut (AI) fusioniert. Unter der Bezeichnung AI bndelt das neue Institut die Grundlagenforschung auf dem Gebiet der Archologie und Altertumswissenschaften an der sterreichischen Akademie der Wissenschaften (AW).
