3209	412	https://vocabs.acdh.oeaw.ac.at/schema#hasAlternativeTitle	http://www.w3.org/1999/02/22-rdf-syntax-ns#langString	de	\N	\N	IKAnt
3210	412	https://vocabs.acdh.oeaw.ac.at/schema#hasDescription	http://www.w3.org/1999/02/22-rdf-syntax-ns#langString	en	\N	\N	The Institute for the Study of Ancient Culture (IKAnt), a research institute at the Austrian Academy of Sciences (OeAW), emerged in 2000 from the Forschungsstelle Archologie, which was created in 1994 through the merger of several Kommissionen. These include among others the Limeskommission (founded in 1897), the Kommission fr Praktische Archologie (which emerged in 1988 from the Unternehmen Ephesos, which had been under the patronage of the Academy since 1954) and the Kommission fr das Corpus Vasorum Antiquorum (founded in 1951). Between 1997 and 2000, the Antiquarian Department of the Balkan-Kommission (founded in 1897) and the Kommission fr das Corpus der antiken Mosaiken Kleinasiens (founded in 1973) were incorporated into IKAnt. Finally, in 2013, the Kommission fr Antike Rechtsgeschichte (founded in 1974), the Numismatische Kommission (founded in 1973) and the Kleinasiatische Kommission (founded in 1896) were incorporated.\nOn 1 January 2021, IKAnt has been merged with the Institute for Oriental and European Archaeology (OREA) and the Austrian Archaeological Institute (OeAI). Under the name OeAI, the new institute focuses on the foundational research in the field of archaeology and classical studies at the Austrian Academy of Sciences (OeAW).
3211	412	https://vocabs.acdh.oeaw.ac.at/schema#hasDescription	http://www.w3.org/1999/02/22-rdf-syntax-ns#langString	de	\N	\N	Das Institut fr Kulturgeschichte der Antike (IKAnt), eine Forschungseinrichtung an der sterreichischen Akademie der Wissenschaften (AW), ging im Jahre 2000 aus der Forschungsstelle Archologie hervor, die 1994 durch den Zusammenschluss mehrerer AW Kommissionen entstanden war: u. a. die Limeskommission (gegrndet 1897), die Kommission fr Praktische Archologie (1988 hervorgegangen aus dem Unternehmen Ephesos, das seit 1954 unter der Patronanz der Akademie stand) und die Kommission fr das Corpus Vasorum Antiquorum (gegr. 1951). Zwischen 1997 und 2000 wurde die Antiquarische Abteilung der Balkan-Kommission (gegr. 1897) und die Kommission fr das Corpus der antiken Mosaiken Kleinasiens (gegr. 1973) ins IKAnt eingegliedert. 2013 schlielich erfolgte Eingliederung der Kommission fr Antike Rechtsgeschichte (gegr. 1974), der Numismatischen Kommission (gegr. 1973) und der Kleinasiatischen Kommission (gegr. 1896).\nMit 1. Jnner 2021 wurde IKAnt mit dem Institut fr Orientalische und Europische Archologie (OREA) und dem sterreichischen Archologischen Institut (AI) fusioniert. Unter der Bezeichnung AI bndelt das neue Institut die Grundlagenforschung auf dem Gebiet der Archologie und Altertumswissenschaften an der sterreichischen Akademie der Wissenschaften (AW).
