--
-- Name: apigetdata(text, text); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.apigetdata(_class text, _searchstr text) RETURNS TABLE(id bigint, property text, value text, lang text)
    LANGUAGE plpgsql
    AS $$

BEGIN
    DROP TABLE IF EXISTS ids;
    CREATE TEMPORARY TABLE ids(id bigint NOT NULL);
        select
            mv.id
        from metadata_view as mv
        where
        mv.property = 'http://www.w3.org/1999/02/22-rdf-syntax-ns#type'
        and mv.value = _class
    );

return query
    select
        mv.id, mv.property, mv.value, mv.lang
    from ids as i
    left join metadata_view as mv on mv.id = i.id
    left join resources as rs on rs.id = mv.id
    where
        mv.property in ('https://vocabs.acdh.oeaw.ac.at/schema#hasTitle', 'https://vocabs.acdh.oeaw.ac.at/schema#hasAlternativeTitle' )
        and LOWER(mv.value) like '%' ||_searchStr || '%'
        and rs.state = 'active';
END
$$;


ALTER FUNCTION gui.apigetdata(_class text, _searchstr text) OWNER TO gui;

--
-- Name: breadcrumb_view_func(bigint, text); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.breadcrumb_view_func(_pid bigint, _lang text DEFAULT 'en'::text) RETURNS TABLE(mainid bigint, parentid bigint, parenttitle text, depth integer, direct_parent bigint, avdate date)
    LANGUAGE sql
    AS $$
    with parents as (
        select *
        from get_relatives(_pid, 'https://vocabs.acdh.oeaw.ac.at/schema#isPartOf', 0)
        where n < 0
    )
    select
        _pid as mainid,
        p.id as parentid,
        (array_agg(mv.value order by case mv.lang when _lang then 0 when 'en' then 1 else 2 end))[1] as parenttitle,
        abs(p.n) as depth,
        (select r.target_id from relations as r where r.id = p.id and r.property = 'https://vocabs.acdh.oeaw.ac.at/schema#isPartOf' limit 1) as direct_parent,
        (select CAST(avd.value as DATE) from metadata_view as avd where avd.id = p.id and avd.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAvailableDate') as avdate
    from
        parents p
        join resources rs using (id)
        join metadata mv using (id)
    where
        rs.state = 'active'
        and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle'
    group by 1, 2, 4
$$;


ALTER FUNCTION gui.breadcrumb_view_func(_pid bigint, _lang text) OWNER TO gui;

--
-- Name: child_sum_views_func(text, text[]); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.child_sum_views_func(_parentid text, _rdftype text[] DEFAULT '{}'::text[]) RETURNS TABLE(countid bigint)
    LANGUAGE plpgsql
    AS $$

BEGIN
    DROP TABLE IF EXISTS child_ids;
    CREATE TEMP TABLE child_ids AS(
    WITH ids AS (
            select
                DISTINCT(r.id)
            from relations as r
            left join identifiers as i on i.id = r.target_id
            left join resources as rs on rs.id = r.id
            where r.property = ANY (_rdftype)
            and rs.state = 'active'
            and i.ids = _parentid
    ) select * from ids
);

RETURN QUERY
    select count(ci.id)
    from child_ids as ci
    left join resources as rs on rs.id = ci.id
    where rs.state = 'active';
END
$$;


ALTER FUNCTION gui.child_sum_views_func(_parentid text, _rdftype text[]) OWNER TO gui;

--
-- Name: child_views_func(text, integer, integer, text, text, text, text[]); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.child_views_func(_parentid text, _limit integer, _page integer, _orderby text, _orderprop text, _lang text DEFAULT 'en'::text, _rdftype text[] DEFAULT '{}'::text[]) RETURNS TABLE(id bigint, title text, avdate timestamp without time zone, description text, accesres text, titleimage text, acdhtype text, version text, orderid integer)
    LANGUAGE sql
    AS $$
    WITH t1 AS (
        SELECT id, row_number() OVER () AS orderid
        FROM (
            SELECT id, ordervalue, CASE _orderby WHEN 'desc' THEN -row_number() OVER () ELSE row_number() OVER () END AS orderid
            FROM (
                SELECT
                    r1.id,
                    (array_agg(m1.value ORDER BY CASE m1.lang WHEN _lang THEN 0 WHEN 'en' THEN 1 WHEN 'de' THEN 2 WHEN 'und' THEN 3 ELSE 4 END))[1] AS ordervalue
                FROM
                    identifiers i
                    JOIN relations r1 ON r1.target_id = i.id AND r1.property = ANY (_rdftype)
                    JOIN metadata m1 ON r1.id = m1.id AND m1.property = _orderprop
                WHERE i.ids = _parentid
                GROUP BY 1
                ORDER BY 2
            ) t
            ORDER BY orderid
        ) t
        LIMIT _limit
        OFFSET _page
    )
    SELECT id, title, avdate, description, accesres, titleimage, acdhtype, version, orderid::int
    FROM (
        SELECT
            t4.id, orderid, title, description, acdhtype, mr3.value as version,
            m5.value_t AS avdate,
            '' AS titleimage, -- left for return type compatibility - the old code was always returning null as wrong property was in use,
            (array_agg(mr2.value ORDER BY CASE mr2.lang WHEN _lang THEN 0 WHEN 'en' THEN 1 WHEN 'de' THEN 2 WHEN 'und' THEN 3 ELSE 4 END))[1] AS accesres
        FROM
            (
                SELECT
                    t3.id, orderid, title, description,
                    (array_agg(m4.value))[1] AS acdhtype
                FROM
                    (
                        SELECT
                            t2.id, orderid, title,
                            (array_agg(m3.value ORDER BY CASE m3.lang WHEN _lang THEN 0 WHEN 'en' THEN 1 WHEN 'de' THEN 2 WHEN 'und' THEN 3 ELSE 4 END))[1] AS description
                        FROM
                            (
                                SELECT
                                    t1.id, orderid,
                                    (array_agg(m2.value ORDER BY CASE m2.lang WHEN _lang THEN 0 WHEN 'en' THEN 1 WHEN 'de' THEN 2 WHEN 'und' THEN 3 ELSE 4 END))[1] AS title
                                FROM
                                    t1
                                    JOIN metadata m2 ON t1.id = m2.id AND m2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle'
                                GROUP BY 1, 2
                            ) t2
                            LEFT JOIN metadata m3 ON t2.id = m3.id AND m3.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasDescription'
                        GROUP BY 1, 2, 3
                    ) t3
                    JOIN metadata m4 ON t3.id = m4.id AND m4.property = 'http://www.w3.org/1999/02/22-rdf-syntax-ns#type' AND m4.value LIKE 'https://vocabs.acdh.%'
                GROUP BY 1, 2, 3, 4
            ) t4
            JOIN metadata m5 ON t4.id = m5.id AND m5.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAvailableDate'
            LEFT JOIN relations r2 ON t4.id = r2.id AND r2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction'
            LEFT JOIN metadata mr2 ON r2.target_id = mr2.id AND mr2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle'
            LEFT JOIN metadata mr3 ON t4.id = mr3.id AND mr3.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasVersion'
        GROUP BY 1, 2, 3, 4, 5, 6, 7
    ) t order by orderid
$$;


ALTER FUNCTION gui.child_views_func(_parentid text, _limit integer, _page integer, _orderby text, _orderprop text, _lang text, _rdftype text[]) OWNER TO gui;

--
-- Name: collection_v2_views_func(text, text); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.collection_v2_views_func(_pid text, _lang text DEFAULT 'en'::text) RETURNS TABLE(id bigint, title text, accesres text, license text, binarysize text, filename text, locationpath text, rdftype text)
    LANGUAGE plpgsql
    AS $$
DECLARE
    _lang2 text := 'de';
BEGIN
    IF _lang = 'de' THEN _lang2 = 'en'; ELSE _lang2 = 'de'; END IF;
    DROP TABLE IF EXISTS accessres;
    CREATE TEMP TABLE accessres AS (
        WITH acs as (
            select
                distinct(r.target_id) as accessid , mv.value,
                mv.lang
            from relations as r
            left join metadata_view as mv on mv.id = r.target_id
            where r.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction'
                and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle'
                and mv.lang = _lang
        ) select * from acs
    );

    DROP TABLE IF EXISTS basic_collection_data;
    CREATE TEMPORARY TABLE basic_collection_data(id bigint);
        WITH RECURSIVE subordinates AS (
            select
                mv.id
            from metadata_view as mv
            where
                mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#isPartOf'
                and mv.value = _pid
            order by mv.property
        ) select * from subordinates
    );

    DROP TABLE IF EXISTS collectionData;
    CREATE TEMP TABLE collectionData(id bigint, title text, accesres bigint, license text, binarysize text, filename text, locationpath text, rdftype text);
        WITH  c2d AS (
            select
                bcd.id,
                COALESCE(
                    (select mv2.value from metadata_view as mv2 where bcd.id = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang limit 1),
                    (select mv2.value from metadata_view as mv2 where bcd.id = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang2 limit 1),
                    (select mv2.value from metadata_view as mv2 where bcd.id = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = 'und' limit 1),
                    (select mv2.value from metadata_view as mv2 where bcd.id = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' limit 1)
                ) as title,
                (select CAST(mv.value as bigint) from metadata_view as mv where mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction' and mv.id = bcd.id limit 1) as accessres,
                (select mv.value from metadata_view as mv where mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasLicense' and mv.id = bcd.id limit 1) as license,
                (select mv.value from metadata_view as mv where mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasBinarySize' and mv.id = bcd.id limit 1) as binarysize,
                (select mv.value from metadata_view as mv where mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasFilename' and mv.id = bcd.id limit 1) as filename,
                (select

		    string_agg(COALESCE(
                (select mv.value from metadata_view as mv where mv.id = rel.id and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv.lang = 'en' limit 1),
                (select mv.value from metadata_view as mv where mv.id = rel.id and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv.lang = 'de' limit 1),
                (select mv.value from metadata_view as mv where mv.id = rel.id and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv.lang = 'und' limit 1),
                (select mv.value from metadata_view as mv where mv.id = rel.id and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' limit 1)
            ) , '/' ORDER BY rel.n asc) as title
        from get_relatives(bcd.id, 'https://vocabs.acdh.oeaw.ac.at/schema#isPartOf', 0) as rel
		where rel.n < 0 ) as locationpath,
				(select mv.value from metadata_view as mv where mv.property = 'http://www.w3.org/1999/02/22-rdf-syntax-ns#type' and mv.id = bcd.id limit 1) as rdftype

            from basic_collection_data as bcd
        ) select * from c2d
    );

RETURN QUERY
    select
        mv.id, mv.title, ar.value, mv.license, mv.binarysize, mv.filename, mv.locationpath, mv.rdftype
    from collectionData as mv
    left join accessres as ar on mv.accesres  = ar.accessid
    left join resources as rs on rs.id = mv.id
    where rs.state = 'active';
END
$$;


ALTER FUNCTION gui.collection_v2_views_func(_pid text, _lang text) OWNER TO gui;

--
-- Name: collection_views_func(text, text); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.collection_views_func(_pid text, _lang text DEFAULT 'en'::text) RETURNS TABLE(mainid bigint, parentid bigint, title text, accesres text, license text, binarysize text, filename text, locationpath text, depth integer)
    LANGUAGE plpgsql
    AS $$
DECLARE
    _lang2 text := 'de';
BEGIN
/* generate the accessrestriction values*/
IF _lang = 'de' THEN _lang2 = 'en'; ELSE _lang2 = 'de'; END IF;
DROP TABLE IF EXISTS accessres;
CREATE TEMP TABLE accessres AS (
    WITH acs as (
        select
        distinct(r.target_id) as accessid , mv.value,
        mv.lang
        from relations as r
        left join metadata_view as mv on mv.id = r.target_id
        where r.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction'
        and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle'
        and mv.lang = _lang
    ) select * from acs
);
/* get only the collection resource and the parent id  and also the depth to we can build up the tree view */
DROP TABLE IF EXISTS basic_collection_data;
CREATE TEMPORARY TABLE basic_collection_data(mainid bigint, parentid bigint, depth integer);
    WITH RECURSIVE subordinates AS (
        SELECT
            mv.id as mainid,
            CAST(mv.value as bigint) as parentid,
            1 as depthval
        FROM
            metadata_view as mv
        WHERE
            mv.value = _pid
            and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#isPartOf'
        UNION
            SELECT
                mv2.id,
                CAST(mv2.value as bigint) as m2val,
                depthval + 1
            FROM
                metadata_view as mv2
            INNER JOIN subordinates s ON s.mainid = CAST(mv2.value as bigint) and  mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#isPartOf'
    ) select * from subordinates
);

/* extend the tree data with the property data what we need to display on the gui */
DROP TABLE IF EXISTS collectionData;
CREATE TEMP TABLE collectionData(mainid bigint, parentid bigint, title text, accesres bigint, license text, binarysize text, filename text, locationpath text, depth integer);
    WITH  c2d AS (
        select
            cd.mainid, cd.parentid,
            COALESCE(
                (select mv2.value from metadata_view as mv2 where cd.mainid  = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang limit 1),
                (select mv2.value from metadata_view as mv2 where cd.mainid  = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang2 limit 1),
                (select mv2.value from metadata_view as mv2 where cd.mainid  = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = 'und' limit 1),
                (select mv2.value from metadata_view as mv2 where cd.mainid  = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' limit 1)
            ) as title,
            (select CAST(value as bigint) from metadata_view where property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction' and id = cd.mainid limit 1) as accessres,
            (select value from metadata_view where property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasLicense' and id = cd.mainid limit 1) as license,
            (select value from metadata_view where property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasBinarySize' and id = cd.mainid limit 1) as binarysize,
            (select value from metadata_view where property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasFilename' and id = cd.mainid limit 1) as filename,
            (select value from metadata_view where property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasLocationPath' and id = cd.mainid limit 1) as locationpath,
            cd.depth
        From basic_collection_data as cd
    ) select * from c2d
);
/* return the results and change the accessrestriction id to the url*/
RETURN QUERY
    select
        mv.mainid, mv.parentid, mv.title, ar.value, mv.license, mv.binarysize, mv.filename, mv.locationpath, mv.depth
    from collectionData as mv
    left join accessres as ar on mv.accesres  = ar.accessid
    left join resources as rs on rs.id = mv.mainid
    where rs.state = 'active'
    order by mv.depth;
END
$$;


