--
-- Name: detail_view_func(text, text); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.detail_view_func(_identifier text, _lang text DEFAULT 'en'::text) RETURNS TABLE(id bigint, property text, type text, value text, relvalue text, acdhid text, vocabsid text, accessrestriction text, language text, lastname text)
    LANGUAGE plpgsql
    AS $$
DECLARE
    /* get the arche gui identifier */
    _main_id bigint := (select i.id from identifiers as i where i.ids =_identifier);
    _lang2 text := 'de';
BEGIN
    IF _lang = 'de' THEN _lang2 = 'en'; ELSE _lang2 = 'de'; END IF;
RETURN QUERY
    WITH dmetaRel as (
        Select
            (CAST(main.id as INT)), main.property, main.type, main.value, '' as relvalue, '' as acdhid, '' as vocabsid, '' as accessrestriction, _lang as lang
        from (
            select
                m.mid, m.id, m.property, m.type, _lang as lang, m.value
            from metadata as m
            where
                m.id = _main_id and ((m.lang <> '') IS NOT TRUE or m.lang IN (_lang, 'und')  )
            UNION
            select
                m3.mid, m3.id, m3.property, m3.type, m3.lang, m3.value
            from metadata as m3
            where
                m3.id = _main_id and ( (m3.lang <> '') IS TRUE and m3.lang NOT IN (_lang, 'und'))
                and not exists (
                    select *
                    from metadata as m
                    where m.id = _main_id and ((m.lang <> '') IS NOT TRUE or m.lang IN (_lang, 'und')) and m.property = m3.property
                )
            order by property
        ) as main
        UNION
        select
            (CAST(rel.id as INT)) ,  rel.property, 'REL' as type, (CAST(rel.relid as VARCHAR)) as value, rel.value as relvalue, rel.acdhid, rel.vocabsid, '' as accessrestriction, _lang as lang
        FROM (
            select
            mv.value as relid,
            COALESCE(
                (select m.value from metadata as m where m.lang = _lang and m.id = CAST(mv.value as bigint) and m.property='https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' limit 1),
                (select m.value from metadata as m where m.lang = _lang2 and m.id = CAST(mv.value as bigint) and m.property='https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' limit 1),
                (select m.value from metadata as m where m.lang = 'und' and m.id = CAST(mv.value as bigint) and m.property='https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' limit 1),
                (select m.value from metadata as m where m.id = CAST(mv.value as bigint) and m.property='https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' limit 1)
            ) as value,
            mv.property,
            i.ids as acdhId,
            i2.ids as vocabsid,
            _lang as lang,
            mv.id as id
            from metadata_view as mv
            left join identifiers as i on i.id = CAST(mv.value as INT) and i.ids LIKE CAST('%.acdh.oeaw.ac.at/api/%' as varchar)
            left join identifiers as i2 on i2.id = CAST(mv.value as INT) and i2.ids LIKE CAST('%vocabs.acdh.oeaw.ac.at/%' as varchar)
            where mv.id = _main_id and mv.type = 'REL'
            order by mv.value
        ) as rel
    )
    select
	dmr.id, dmr.property, dmr.type,
	dmr.value,
	dmr.relvalue,
	dmr.acdhid,
	dmr.vocabsid,
	dmr.accessrestriction,
	dmr.lang,
        (select ln.value from metadata_view as ln where ln.id = CAST(dmr.value as INT) and dmr.type='REL' and ln.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasLastName' limit 1) as lastname
    from dmetaRel as dmr
    left join resources as rs on rs.id = dmr.id and rs.state = 'active'
    UNION
    Select
        mv.id, mv.property, mv.type, mv.value, '' as relvalue, '' as acdhid, '' as vocabsid, '' as accessrestriction, mv.lang, ''
    from metadata_view as mv where mv.type = 'ID' and mv.id = _main_id
    order by property;
END
$$;


ALTER FUNCTION gui.detail_view_func(_identifier text, _lang text) OWNER TO gui;

--
-- Name: get_child_table_func(text, text, text[]); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.get_child_table_func(_identifier text, _lang text DEFAULT 'en'::text, _rdftype text[] DEFAULT '{}'::text[]) RETURNS TABLE(id bigint, property text, title text, type text, accessres text, sumcount bigint)
    LANGUAGE plpgsql
    AS $$
DECLARE _lang2 text := 'de';
BEGIN


DROP TABLE IF EXISTS counted;
CREATE TEMPORARY TABLE counted AS (
	select
    	COUNT(*) as sumcount
    from metadata_view as mv
    where
    	mv.value = _identifier
    	and mv.property = ANY (_rdftype)
);

RETURN QUERY
WITH properties AS (
    select
        DISTINCT(mv.id), mv.property
    from metadata_view as mv
    where
        mv.value = _identifier
        and mv.property = ANY (_rdftype)
	) select
        iv.id, iv.property,
        COALESCE(
            (select mv2.value from metadata_view as mv2 where mv2.id = iv.id  and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang LIMIT 1),
            (select mv2.value from metadata_view as mv2 where mv2.id = iv.id  and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang2 LIMIT 1),
            (select mv2.value from metadata_view as mv2 where mv2.id = iv.id  and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = 'und' LIMIT 1),
            (select mv2.value from metadata_view as mv2 where mv2.id = iv.id  and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle'  LIMIT 1)
        ) as title,
        (select mv2.value from metadata_view as mv2 where mv2.id = iv.id  and mv2.property = 'http://www.w3.org/1999/02/22-rdf-syntax-ns#type') as type,
        COALESCE(
            (select mv2.value from metadata_view as mv left join metadata_view as mv2 on mv2.id = CAST(mv.value AS INT) where  mv.id = iv.id and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction' and mv2.property ='https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang LIMIT 1 ),
            (select mv2.value from metadata_view as mv left join metadata_view as mv2 on mv2.id = CAST(mv.value AS INT) where  mv.id = iv.id and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction' and mv2.property ='https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang2 LIMIT 1 ),
            (select mv2.value from metadata_view as mv left join metadata_view as mv2 on mv2.id = CAST(mv.value AS INT) where  mv.id = iv.id and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction' and mv2.property ='https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = 'und' LIMIT 1 ),
            (select mv2.value from metadata_view as mv left join metadata_view as mv2 on mv2.id = CAST(mv.value AS INT) where  mv.id = iv.id and mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasAccessRestriction' and mv2.property ='https://vocabs.acdh.oeaw.ac.at/schema#hasTitle'  LIMIT 1 )
        ) as accessres,
            (select c.sumcount from counted as c limit 1) as sumcount
    from properties as iv
    left join resources as rs on rs.id = iv.id
    where rs.state = 'active'
	group by iv.id, iv.property;
END
$$;


ALTER FUNCTION gui.get_child_table_func(_identifier text, _lang text, _rdftype text[]) OWNER TO gui;

--
-- Name: get_members_func(text, text); Type: FUNCTION; Schema: gui; Owner: gui
--

CREATE FUNCTION gui.get_members_func(_repoid text, _lang text DEFAULT 'en'::text) RETURNS TABLE(id bigint, title text)
    LANGUAGE plpgsql
    AS $$
    DECLARE _lang2 text := 'de';
    DECLARE _lang3 text := 'und';
BEGIN
    IF _lang = 'de' THEN _lang2 = 'en'; ELSE _lang2 = 'de'; END IF;
RETURN QUERY
    WITH subordinates AS (
        select
            mv.id,
            COALESCE(
                (select mv2.value from metadata_view as mv2 where mv.id = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang limit 1),
                (select mv2.value from metadata_view as mv2 where mv.id = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang2 limit 1),
                (select mv2.value from metadata_view as mv2 where mv.id = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' and mv2.lang = _lang3 limit 1),
                (select mv2.value from metadata_view as mv2 where mv.id = mv2.id and mv2.property = 'https://vocabs.acdh.oeaw.ac.at/schema#hasTitle' limit 1)
            ) as title
        from
        metadata_view as mv
        left join resources as rs on rs.id = mv.id
        where
        mv.property = 'https://vocabs.acdh.oeaw.ac.at/schema#isMemberOf'
        and mv.value = _repoid
        and rs.state = 'active'
    ) select * from subordinates order by title;
END
$$;


