--
-- Name: get_relatives(bigint, text, integer, integer, boolean, boolean); Type: FUNCTION; Schema: public; Owner: www-data
--

CREATE FUNCTION public.get_relatives(res_id bigint, rel_prop text, max_depth_up integer DEFAULT 999999, max_depth_down integer DEFAULT '-999999'::integer, neighbors boolean DEFAULT false, reverse boolean DEFAULT false, OUT id bigint, OUT n integer) RETURNS SETOF record
    LANGUAGE sql STABLE PARALLEL SAFE
    AS $$
    WITH RECURSIVE ids(id, n, m) AS (
        SELECT res_id, 0, ARRAY[res_id] FROM resources WHERE id = res_id AND state = 'active'
      UNION
        SELECT
          CASE r.target_id WHEN ids.id THEN r.id ELSE r.target_id END,
          CASE r.target_id WHEN ids.id THEN ids.n + 1 ELSE ids.n - 1 END,
          CASE r.target_id WHEN ids.id THEN ARRAY[r.id] ELSE ARRAY[r.target_id] END || m
        FROM 
          relations r 
          JOIN ids ON (max_depth_up > 0 AND ids.n >= 0 AND ids.n < max_depth_up AND r.target_id = ids.id AND NOT r.id = ANY(ids.m)) OR (max_depth_down < 0 AND ids.n <= 0 AND ids.n > max_depth_down AND r.id = ids.id AND NOT r.target_id = ANY(ids.m))
        WHERE property = rel_prop OR rel_prop IS NULL
    )
    SELECT id, n 
    FROM 
        ids
        FULL JOIN (
            SELECT DISTINCT target_id AS id
            FROM ids JOIN resources USING(id) JOIN relations r USING (id)
            WHERE neighbors AND state = 'active'
        ) neighbors USING (id)
        FULL JOIN (
            SELECT DISTINCT id
            FROM relations JOIN resources USING (id)
            WHERE target_id = res_id AND reverse AND state = 'active'
        ) reverse USING (id)
  ;
$$;


ALTER FUNCTION public.get_relatives(res_id bigint, rel_prop text, max_depth_up integer, max_depth_down integer, neighbors boolean, reverse boolean, OUT id bigint, OUT n integer) OWNER TO "www-data";

--
-- Name: get_relatives_metadata(bigint, text, integer, integer, boolean, boolean); Type: FUNCTION; Schema: public; Owner: www-data
--

CREATE FUNCTION public.get_relatives_metadata(res_id bigint, rel_prop text, max_depth_up integer DEFAULT 999999, max_depth_down integer DEFAULT '-999999'::integer, neighbors boolean DEFAULT true, reverse boolean DEFAULT false) RETURNS SETOF public.metadata_view
    LANGUAGE sql STABLE PARALLEL SAFE
    AS $$
    WITH ids AS (
        SELECT * FROM get_relatives(res_id, rel_prop, max_depth_up, max_depth_down, neighbors, reverse)
    )
    SELECT id, property, type, lang, value
    FROM metadata JOIN ids USING (id)
  UNION
    SELECT id, null::text AS property, 'ID'::text AS type, null::text AS lang, ids AS value
    FROM identifiers JOIN ids USING (id)
  UNION
    SELECT id, property, 'REL'::text AS type, null::text AS lang, target_id::text AS value
    FROM relations r JOIN ids USING (id)
  ;
$$;


ALTER FUNCTION public.get_relatives_metadata(res_id bigint, rel_prop text, max_depth_up integer, max_depth_down integer, neighbors boolean, reverse boolean) OWNER TO "www-data";

--
-- Name: get_resource_roles(text, text); Type: FUNCTION; Schema: public; Owner: www-data
--

CREATE FUNCTION public.get_resource_roles(read_prop text, write_prop text) RETURNS TABLE(id bigint, role text, privilege text)
    LANGUAGE sql STABLE PARALLEL SAFE
    AS $$
    SELECT id, value, 'read' 
    FROM resources JOIN metadata USING (id) 
    WHERE property = read_prop 
  UNION
    SELECT id, value, 'read' 
    FROM resources JOIN metadata USING (id) 
    WHERE property = write_prop
  ;
$$;


